import React from 'react'
import '../css/login.css'

function LoginPage () {
  const loginClick = () => {
    const logInButton = document.getElementb('login-button');
    console.log(logInButton); console.log('-------------');
    //logInButton.classList.toggle('.login-button.clicked');
  }

  return (
    <div className="app-container">
      <div className="login-main">
        <div className="login-form">
          <div className="logo">
            <img src="./pics/icons/logo.png" alt=""/>
            <h3>WATCH</h3>
          </div>
          <p>Enjoy the newest movies</p>
          <div className="login-button" onClick={loginClick}><a href="#">Log in</a></div>
          <p>No account? <a href="#">Sign up</a></p>
        </div>
        <div className="login-input hidden">
          <input type="text" placeholder="EMAIL...demo" id="login-email"/>
          <input type="text" placeholder="PASSWORD...demo" id="login-password"/>
          <div className="login-button" id="login-confirm"><a href="#">WATCH</a></div>
        </div>
      </div>
    </div>
  );
}

export default LoginPage;
